Antlia D'Loftpompel (Latäin: Antlia) ass e Stärebild südlech vum Himmelsequator. Inhaltsverzeechnes Beschreiwung[änneren | Quelltext änneren] D'Antlia ass en onschäinbaart Stärebild, dat sech aus liichtschwaache Stäre zesummesetzt. Nëmmen den hellste Stär, a Antliae, erreecht déi 4. Gréissteklass. Eng Observatioun vun deem Stärebild ass ganz schwéier, well et am Fréijoer nëmmen e puer Grad iwwer dem Horizont steet. Geschicht[änneren | Quelltext änneren] De franséischen Astronom Nicolas Louis de 
..........
] Stären[änneren | Quelltext änneren] Den hellste Stär, a Antilae läit op enger Distanz vun 366 Liichtjoer vun eis ewech, hie liicht orange a gehéiert zu der Spektralklass K6 III. Méifachstären[änneren | Quelltext änneren] Den Z1 Antilae ass e Dräifachstäresystem op enger Distanz vun 372 Liichtjoer. Verännerlech Stären[änneren | Quelltext änneren] Den U Antilae ass en déifroude verännerleche Stär vun der Spektralklass C5. Hie läit 840 Liichtjoer vun eiser Äerd ewech. E verännert seng Hellegkeet
